import { Nav, Container, Image, Row, Col, NavDropdown, NavbarBrand } from "react-bootstrap";
import { Link } from "react-router-dom";
import logo from './img/magazine.svg';

const HeaderApp = () => {
    return (
        <Container>
            <Row>
                <Col xs={12}>
                <Image src={logo} className="logo"></Image>
                </Col>
            </Row>
            <Row className="custom-navbar">
                 <Nav.Link to="/">Home</Nav.Link>
                 <Nav.Link to='/post'>Post</Nav.Link>
                 <NavDropdown title={<span>Category</span>}>
                    <Nav.Item>
                        <Nav.Link to='/post'>Discovery</Nav.Link>
                        <Nav.Link to='/post'>PC game</Nav.Link>
                        <Nav.Link to='/post'>Mobile game</Nav.Link>
                        <Nav.Link to='/post'>Console game</Nav.Link>
                    </Nav.Item>
                    <Nav.Item></Nav.Item>
                    <Nav.Item></Nav.Item>
                 </NavDropdown>
            </Row>
        </Container>
    );
}

export default HeaderApp;
